import React, { Component } from 'react'
import { Toast, ToggleButton } from 'react-bootstrap';

export function About({ toggle }) {
    return (
        <Toast onClose={() => toggle(false)}>
            <Toast.Header>
                <strong className="mt-auto">Your order is in the oven!</strong>
                <small>just now</small>
            </Toast.Header>
            <Toast.Body>
                Your delicious pizza will be with you in 30 minutes!
            </Toast.Body>
        </Toast>
    );
}
